import React from "react";
import "../styles/AdminDashboard.css";
import Logo from "../assets/logo light.jpg";

function AdminDashboard({ auth, setAuth }) {
  const handleLogout = () => {
    localStorage.clear();
    setAuth({ isAuthenticated: false, role: null, username: "" });
  };

  return (
    <div
      style={{ padding: "2rem", backgroundColor: "#f8f9fa" }}
      className="admn-dashboard"
    >
      <div className="top-line">
        <div className="top-left">
          <div className="menui">
            <i className="fas fa-bars menu-icon"></i>
          </div>
          {/* <img src="Assects/logo light.jpg" width="80px" alt="Gmail Logo" /> */}
          <img src={Logo} alt="Gmail Logo" style={{ width: "80px" }} />
        </div>
        {/* style="display: flex;align-items: center; gap: 10px;margin-right: 20px;" */}
        <div
          style={{
            display: "flex",
            alignItems: "center",
            gap: "10px",
            marginRight: "20px",
          }}
        >
          {/* <img src="Assects/user-image.jpg" width="30px" style="border-radius: 50%;" alt=""> */}
          <h6>Thanush</h6>
          <h6>[Admin]</h6>
        </div>
      </div>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
}

export default AdminDashboard;
